import React from "react";

function Header() {
  return (
    <>
      <header className="row container"> 
          <div className="logo">
              <a href="#">
                  <img src="../images/logo.png"/>
              </a>
          </div>


          <div>
              <button className="freetrial"></button>
          </div>
      </header>
    </>
  );
}

export default Header;
